          parameters: [{name: files, value: root://eospublic.cern.ch//eos/opendata/cms/MonteCarlo2012/Summer12_DR53X/W2JetsToLNu_TuneZ2Star_8TeV-madgraph/AODSIM/PU_S10_START53_V19-v1/20000/0053F146-74E4-E211-9EFF-00261894398B.root}, {name: it, value: 1}]
